  const segmentdisayn=
  {
     backgroundColor:"#E0E0E0",
  }
  return (
    <Segment style={segmentdisayn} >
      <Grid columns={2} relaxed="very">
        <Grid.Column>
          
          <UyeOlYonlendirme />
        </Grid.Column>
        <Grid.Column>
          <Login />
        </Grid.Column>
      </Grid>
      <Divider vertical>Or</Divider>
    </Segment>
  );
}
